import React from 'react';
import './User.css'; // Import the CSS file

const Sidebar = () => {
    return (
        <div className="sidebar">
            <div className='image'><img src='/office-workplace.svg'></img><span>User</span></div>

            <a href="#home">Dashboard</a>
            <a href="#services">Expenses</a>
            <a href="#about">Income</a>
            <a href="#contact">Transections</a>
        </div>
    );
};

const Navbar = () => {
    return (
        <div className="navbar">
            <button className=''></button>
        </div>
    );
};

const MainContent = () => {
    return (
        <div className="main-content">
            <div className="content">
                <h2>Main Content Area</h2>

            </div>
        </div>
    );
};

const App = () => {
    return (
        <>
            <Sidebar />
            <Navbar />
            <MainContent />
        </>
    );
};

export default App;
